    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS), in cooperation
    with the National Oceanic and Atmospheric Administration (NOAA) and the Massachusetts
    Office of Coastal Zone Management (MA CZM), is producing detailed geologic maps
    of the coastal sea floor. Imagery, originally collected by NOAA for charting purposes,
    provides a fundamental framework for research and management activities along this
    part of the Massachusetts coastline, shows the composition and terrain of the seabed,
    and provides information on sediment transport and benthic habitat. Interpretive
    data layers were derived from multibeam echo-sounder and sidescan-sonar data collected
    in the vicinity of Woods Hole, a passage between the Elizabeth Islands and Cape
    Cod, Massachusetts. In November 2007, bottom photographs, seismic-reflection profiles,
    and surficial sediment data were acquired as part of a ground-truth reconnaissance
    survey.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
